'use strict';
let exception = require('@gehtsoft/LuaxStdlib-node').exception;
//@@DocBrief("The class for getting persistent session messages")
class AGetPersistentSessionMessage {
    persistentSession;
    error;
    userKind;
    userId;
    options;
    requestId;
    constructor() {
        this.persistentSession = null;
        this.error = null;
        this.userKind = null;
        this.userId = null;
        this.requestId = null;
    }
    getPersistentSession() {
        return this.persistentSession;
    }
    getError() {
        return this.error;
    }
    getUserKind() {
        return this.userKind;
    }
    getUserId() {
        return this.userId;
    }
    getType() {
        throw exception.create(0, "Not implemented getType()");
    }
    getOptions() {
        return this.options;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = AGetPersistentSessionMessage
